import axios from "axios";

const BASE_URL = "https://pokeapi.co/api/v2";
export const getAllPokemon = async ()=> {
    const response = axios.get(`${BASE_URL}/pokemon?limit=100000&offset=0`).then((res) => {
        const data: string = res.data;
        return data;
    })
    return response;
}
